import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import useStore from "../store/useStore";
import BlogCard from "./BlogCard";
import Services from "./Services";
import bannerImg from "../assets/blog-banner.jpg"; // ✅ make sure it's in src/assets

export default function BlogDetail() {
  const { id } = useParams();
  const navigate = useNavigate();
  const blogs = useStore((state) => state.blogs);

  const blog = blogs.find((b) => String(b.id) === id);

  if (!blog) {
    return (
      <Container style={{ padding: "60px 20px", textAlign: "center" }}>
        <h2>Blog not found</h2>
        <button
          onClick={() => navigate("/blog")}
          style={{
            marginTop: "20px",
            padding: "10px 20px",
            background: "#246A21",
            border: "none",
            borderRadius: "6px",
            color: "#fff",
            cursor: "pointer",
          }}
        >
          Back to Blogs
        </button>
      </Container>
    );
  }

  // Pick 3 related blogs (excluding the current one)
  const related = blogs.filter((b) => b.id !== blog.id).slice(0, 3);

  return (
    <>
      {/* ✅ Banner Section */}
      <section style={{ position: "relative", width: "100%" }}>
        <div
          style={{
            height: "500px",
            borderRadius: "10px",
            backgroundImage: `url(${bannerImg})`,
            backgroundSize: "cover",
            backgroundPosition: "center",
            backgroundRepeat: "no-repeat",
          }}
        >
          {/* ✅ Optional dark overlay */}
          <div
            style={{
              height: "100%",
              width: "100%",
              backgroundColor: "rgba(0,0,0,0.4)",
              borderRadius: "10px",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <h1
              style={{
                color: "#fff",
                fontFamily: "Raleway",
                fontSize: "48px",
                fontWeight: 700,
                textAlign: "center",
                textTransform: "capitalize",
              }}
            >
              {blog.title}
            </h1>
          </div>
        </div>
      </section>

      {/* ✅ Blog Content Section */}
      <section style={{ padding: "40px 0" }}>
        <Container>
          {/* ✅ Subtitle / Intro */}
          <p
            style={{
              color: "#666",
              fontFamily: "Raleway",
              fontSize: "22px",
              lineHeight: "150%",
              marginBottom: "40px",
            }}
          >
            {blog.excerpt ||
              "Are you here for something specific or just to explore? Here’s a quick insight..."}
          </p>

          {/* ✅ Secondary Heading */}
          <h2
            style={{
              color: "#333",
              fontFamily: "Raleway",
              fontSize: "32px",
              fontWeight: 600,
              lineHeight: "140%",
              textTransform: "capitalize",
              marginBottom: "20px",
            }}
          >
            {blog.subtitle || "I Produced A Unique Developer Rap Video"}
          </h2>

          {/* ✅ Full Blog Content */}
          <p
            style={{
              color: "#666",
              fontFamily: "Raleway",
              fontSize: "20px",
              lineHeight: "150%",
              marginBottom: "40px",
            }}
          >
            {blog.content ||
              "Full blog content goes here. Expand this section with real details from the database or CMS."}
          </p>

          {/* ✅ Related Blogs */}
          {related.length > 0 && (
            <div style={{ marginTop: "60px" }}>
              <h3
                style={{
                  color: "#333",
                  fontFamily: "Raleway",
                  fontSize: "36px",
                  fontWeight: 700,
                  marginBottom: "20px",
                }}
              >
                Related Blog
              </h3>
              <Row xs={1} sm={2} md={3} className="g-4">
                {related.map((b) => (
                  <Col key={b.id}>
                    <div
                      style={{ cursor: "pointer" }}
                      onClick={() => navigate(`/blog/${b.id}`)}
                    >
                      <BlogCard blog={b} />
                    </div>
                  </Col>
                ))}
              </Row>
            </div>
          )}
        </Container>
      </section>

      {/* ✅ Services Section */}
      <div style={{ marginTop: "80px", width: "100%" }}>
        <Services />
      </div>
    </>
  );
}
